pragma solidity ^0.4.18;
import "../interfaces/IUserStorage.sol";
import "./SafeMathEx.sol";
import "zeppelin-solidity/contracts/token/ERC20.sol";

// Central storage for accounts implementation
contract UserStorage is IUserStorage {
    using SafeMathEx for uint256;
    using SafeMathEx for uint64;

    // This means that in timeframe D1..D2 account can lose 1/4 of its FR at most
    uint256 constant FIRST_DECAY_PERIOD_PART = 4;

    // Promille coefficient of max decay in the 1st decay period, i.e. 1000-1000/FIRST_DECAY_PERIOD_PART
    uint256 decayCoefficient;

    // Ctor
    function UserStorage(address _token, address _owner) public Version("1.0.0") {
        token = ERC20(_token);
        owner = _owner;

        allowMigrations = true;
    }

    // Lock migrations of accounts and their FR
    function lockMigrations() public onlyOwner() isPossibleToMigrate() {
      allowMigrations = false;
    }

    // Sets decay parameters,
    // all args are time periods in days, assumed (but not required) that _D3-_D2 < _D2-_D1
    function setupDecayParams(
        uint256 _D1,
        uint256 _D2,
        uint256 _D3
    )
        public
        onlyOwner()
    {
        require(_D1 > 0 && _D2 > _D1 && _D3 > _D2 && _D3 < 365*5);
        D1 = _D1 * 1 days;
        D2 = _D2 * 1 days;
        D3 = _D3 * 1 days;
        decayCoefficient = SafeMathEx.sub(1000, 1000/FIRST_DECAY_PERIOD_PART);
    }

    // Special function to setup already known account and assign it some dFR from alpha version projects
    function migrateFR(
        address _account,
        int32 _dFR
    )
        public
        onlyOwner()
        isPossibleToMigrate()
    {
        AccountData storage a = accounts[_account];
        if (a.lastOpenTimestamp == 0) {
            addAccount(_account);
        }

        if (_dFR > 0) {
            a.FR = a.FR.add64(uint64(_dFR));
            totalFR = totalFR.add(uint256(_dFR));
        } else if (_dFR < 0) {
            uint64 toSub = uint64(-_dFR);
            if (toSub < a.FR) {
                a.FR = a.FR.sub64(toSub);
                totalFR = totalFR.sub(toSub);
            } else {
                totalFR = totalFR.sub(a.FR);
                a.FR = 0;
            }
        }
    }

    // Reserve some more WINGS for account.
    // Called by account to reserve WINGS for itself.
    function reserveWings(
        uint256 _amount
    )
        public
    {
        AccountData storage a = accounts[msg.sender];
        if (a.lastOpenTimestamp == 0) {
            addAccount(msg.sender);
        }

        if (_amount > 0) {
            deposit(msg.sender, _amount);
            a.wingsBalance = a.wingsBalance.add(_amount);
            totalReserved = totalReserved.add(_amount);
        }

        WINGS_RESERVED(msg.sender, _amount, accounts[msg.sender].wingsBalance);
    }

    // Adds a new project to an account: places address of Forecasting contract
    // Called by owner
    function addProject(
        address _account,
        address _forecastingContract
    )
        public
        onlyOwner()
    {
        require(_forecastingContract != address(0) && _account != address(0));

        if (accounts[_account].projects[_forecastingContract] != ProjectState.DoesNotExist) {
          // Just return if project already added
          return;
        }

        AccountData storage a = accounts[_account];
        if (a.lastOpenTimestamp == 0) {
            addAccount(_account);
        }

        // Now this Rewards contract is allowed to manipulate _account's FR
        accounts[_account].projects[_forecastingContract] = ProjectState.Reserved;

        PROJECT_ADDED(_account, _forecastingContract);
    }

    // Forecasting contract makes locks wings from account
    // Called by Forecasting contract
    function openProject(
        address _account,
        uint256 _amount
    )
        public
        decayParamsAreSet()
        accountMustExist(_account, true)
        projectMustBeReserved(_account)
        returns (uint64 FR, uint256 locked)
    {
        AccountData storage a = accounts[_account];
        a.projects[msg.sender] = ProjectState.Active;

        uint256 diff = a.wingsBalance.sub(a.wingsLocked);
        require(_amount <= diff);

        if (_amount == 0) {
          _amount = diff;
        }

        a.wingsLocked = a.wingsLocked.add(_amount);
        totalLocked = totalLocked.add(_amount);

        ++a.nActiveProjects;

        uint256 ts = block.timestamp;

        if (a.FR > 0) {
            uint256 newFR;
            uint256 dT = ts.sub(a.lastOpenTimestamp);
            if (dT > D3) {
                // All decay periods expired, rating is lost
                a.FR = 0;
            } else if (dT > D2) {
                // the 2nd decay period, FR goes down rapidly

                newFR = a.FR;

                newFR = newFR.mul(decayCoefficient).mul(
                    SafeMathEx.sub(
                        1000,
                        dT.sub(D2).mul(1000) / D3.sub(D2)
                    )
                ) / 1000000;

                a.FR = uint64(newFR);
            } else if (dT > D1) {
                // the 1st decay period, FR goes down slowly

                newFR = a.FR;

                newFR = newFR.mul(
                    SafeMathEx.sub(
                        1000,
                        dT.sub(D1).mul(1000) / D2.sub(D1) / FIRST_DECAY_PERIOD_PART
                    )
                ) / 1000;

                a.FR = uint64(newFR);
            }
        }

        a.lastOpenTimestamp = uint64(ts);

        FR = a.FR;
        locked = a.wingsLocked;

        PROJECT_OPENED(_account, msg.sender);
    }

    // Locks WINGS upto given amount (to increase weight)
    // Called by Forecasting contract
    function lockWings(
        address _account,
        uint256 _amount
    )
        public
        accountMustExist(_account, true)
        projectMustBeActive(_account)
        returns (uint256 wingsLocked)
    {
        AccountData storage a = accounts[_account];
        uint256 diff = a.wingsBalance.sub(a.wingsLocked);

        require(_amount <= diff);

        if (_amount == 0) {
          _amount = diff;
        }

        a.wingsLocked = a.wingsLocked.add(_amount);
        totalLocked = totalLocked.add(_amount);

        wingsLocked = a.wingsLocked;
    }

    // Forecasting contract changes account's FR and deactivates itself in the storage
    // Called by Forecasting contract
    function closeProject(
        address _account,
        int32 _dFR,
        bool _cancelProject
    )
        public
        accountMustExist(_account, true)
        projectMustBeActive(_account)
    {
        AccountData storage a = accounts[_account];
        assert(a.nActiveProjects > 0);

        if (_dFR > 0) {
            a.FR = SafeMathEx.add64(a.FR, uint64(_dFR));
            totalFR = totalFR.add(uint64(_dFR));
        } else if (_dFR < 0) {
            uint64 absD = uint64(-_dFR);
            if (absD >= a.FR) {
                totalFR = totalFR.sub(a.FR);
                a.FR = 0;
            } else {
                totalFR = totalFR.sub(absD);
                a.FR = SafeMathEx.sub64(a.FR, absD);
            }
        }

        a.projects[msg.sender] = _cancelProject ? ProjectState.DoesNotExist : ProjectState.Closed;
        if (--a.nActiveProjects == 0) {
            totalLocked = totalLocked.sub(a.wingsLocked);
            a.wingsLocked = 0;
        }

       PROJECT_CLOSED(_account, msg.sender, _dFR, a.FR);
    }

    // Releases (i.e. withdraws) WINGS reserved by account
    // Called by account
    // Returns WINGS released
    function releaseWings(uint256 _maxAmount)
        public
        accountMustExist(msg.sender, true)
        returns (uint256 released)
    {
        AccountData storage a = accounts[msg.sender];
        released = a.wingsBalance.sub(a.wingsLocked);

        if (_maxAmount != 0) {
          require(_maxAmount <= released);
          released = _maxAmount;
        }

        if (!token.transfer(msg.sender, released)) {
            revert();
        }

        a.wingsBalance = a.wingsBalance.sub(released);
        totalReserved = totalReserved.sub(released);

        WINGS_RELEASED(msg.sender, released);
    }

    // Gets FR by address
    function getFR(
        address _account
    )
        public
        constant
        returns (uint64 FR)
    {
        FR = accounts[_account].FR;
    }

    // Gets reserved WINGS by address
    function getWingsBalance(
        address _account
    )
        public
        constant
        returns (uint256 balance)
    {
        balance = accounts[_account].wingsBalance;
    }

    // Gets locked WINGS by address
    function getLockedWings(
        address _account
    )
        public
        constant
        returns (uint256 locked)
    {
        locked = accounts[_account].wingsLocked;
    }

    // Adds a new account to storage
    function addAccount(
        address _newAccount
    )
        internal
    {
        AccountData storage a = accounts[_newAccount];
        assert(a.lastOpenTimestamp == 0);
        a.lastOpenTimestamp = uint64(block.timestamp);

        ACCOUNT_ADDED(_newAccount);
    }

    // Makes a transfer of Wings from account to storage
    function deposit(
        address _account,
        uint256 _value
    )
        internal
    {
        uint256 allocated = token.allowance(_account, address(this));
        require(allocated >= _value);
        if (!token.transferFrom(_account, address(this), _value)) {
            revert();
        }
    }
}
